function pushWindow() {
	'use strict';
	var scrollTop = $(window).scrollTop();

	$('.section01').css('transform', 'translateY(-' + scrollTop / 5 + 'px)');
	$('.section01 .container').css('transform', 'translateY(-' + scrollTop / 8 + 'px)');

	
    SmoothScroll({ // Scrolling Core
        animationTime: 400, // [ms]
        stepSize: 50, // [px]

        // Acceleration
        accelerationDelta: 50, // 50
        accelerationMax: 3, // 3

        // Keyboard Settings
        keyboardSupport: true, // option
        arrowScroll: 50, // [px]

        // Pulse (less tweakable)
        // ratio of "tail" to "acceleration"
        pulseAlgorithm: true,
        pulseScale: 4,
        pulseNormalize: 1,

        // Other
        touchpadSupport: false, // ignore touchpad by default
        fixedBackground: false,
        excluded: ''
    });


}




